import React, { Component } from 'react';
import {Button, FormGroup, FormControl, ControlLabel, Grid, Row, Col, Tooltip, OverlayTrigger} from 'react-bootstrap';
import './../../resources/styles/style.css';
import './Report.css';
import Label from './../../components/Label.js';
import TextBox from './../../components/TextBox.js';
import {Animated} from "react-animated-css";
import Iframe from 'react-iframe';
import Header from './../../components/Header.js';

class Report extends Component {
  constructor(props) {
    super(props);

    this.state={activeTabId : 0};
    this.onHeaderButtonsClick = this.onHeaderButtonsClick.bind(this);
  }

  onHeaderButtonsClick(event)
  {
    console.log(event.target.name);
    if(event.target.name == "report")
    {
      this.props.history.push('/report');
    }
    else if(event.target.name == "config")
    {
      console.log('config');
      this.props.history.push('/config');
    }
    else if(event.target.name == "home")
    {
      this.props.history.push('/dashboard');
    }
    else if(event.target.name == "logout")
    {
      this.props.history.push('/');
    }
  }


  render() {
    return (
        <div className="manageReports">
            <Header text="Hi Admin, Good Morning - You were last logged in at 10 AM 21-11-2018" onClick={this.onHeaderButtonsClick}/>

            <div className="navBar">
                <div className="navBarPanel">
                  <div className="navBarPanelButton"><img src={require('./../../resources/images/singtel-logo.png')} className="navPanelLogo" name="report"/></div>

                  <div className={(this.state.activeTabId == "1") ? 'navBarPanelButton navBarPanelButtonActive': 'navBarPanelButton'} id="1" onClick={this.onReportClick}><img src={require('./../../resources/images/manage_report.png')} className="navPanelIcon" name="manageReport" />Manage Reports</div>
                  <div className={(this.state.activeTabId == "2") ? 'navBarPanelButton navBarPanelButtonActive': 'navBarPanelButton'} id="2" onClick={this.onReportClick}><img src={require('./../../resources/images/team.png')} className="navPanelIcon" name="manageUsers" />Manage Users</div>
                </div>
                <div className="navBarWindow">
                  {(this.state.activeTabId == "1")?
                      (<div></div>):
                                        ((this.state.activeTabId == "2")?
                      (<div>BRIJ</div>):
                      (<div>RAJ</div>))}

                </div>
              </div>

        </div>
    );
  }
}

export default Report;
